import React, { useState } from 'react';
import {
    View,
    StyleSheet,
    Text,
    TouchableOpacity as TO,
    CheckBox
  } from "react-native";
import Entrada from '../components/Entrada'

export default function SingUp2(){
  
    const [textEmail, setEmail] = useState(' ');
    const [textConfirmEmail, setConfirmEmail] = useState(' ');
    const [textUser, setUser] = useState(' ');
    const [textPassword, setPassword] = useState(' ');
    const [textConfirmPassword, setConfirmPassword] = useState(' ');

    const [isSelected, setSelection] = useState(false)

    const confirm = 'Confirmar';
    return(
        <>

        <View style = {styles.container}>
        <Entrada label='Digite seu e-mail' setValue={setEmail} value={textEmail}/>
        <Entrada label='Confirme seu e-mail' setValue={setConfirmEmail} value={textconfirmEmail}/>

        <Entrada label='Usuário' setValue={setUser} value={textUser}/>

        <Entrada label='Digite sua senha' setValue={setPassword} value={textPassword}/>
        <Entrada label='Confirmar senha' setValue={setConfirmPassword} value={textConfirmPassword}/>
        </View>/

      <View>
        <TO>
          <Text>{confirm}</Text>
        </TO>

        <View style={styles.checkboxContainer}> 
          <CheckBox 
          value = {isSelected}
          onvalueChange = {setSelection}
          style = {styles.checkbox} 
          /> <Text>Li e aceito os termos de condições</Text>
        </View>
      </View>

        </>
    )
}

const styles = StyleSheet.create({
    container:{
        flex: 1,
        backgroundColor: '#83A1EF',
        justifycontent:'center',
        alignItems: 'center'
    },
    to: {
        borderColor: "black",
        borderWidth: 1,
        borderRadius: 5,
        height: 20,
        width: 60,
        alignItems: 'center',
    
      },
      text: {
        color: "white",
      },
      checkbox:{
        alignSelf: 'center',
      },
      checkboxContainer: {
        flexDirection: 'row',
        marginBottom: 20,
      },

})
